import React, { useEffect, useState } from "react";
import { Box, Typography, Grid, Paper, Button, TextField } from "@mui/material";
import { getCart, removeFromCart, updateCartItem } from "../api/cart";
import { useNavigate } from "react-router-dom";

export default function CartPage() {
  const [items, setItems] = useState([]);
  const navigate = useNavigate();

  const fetch = () => {
    getCart()
      .then((res) => setItems(res.data))
      .catch(console.error);
  };

  useEffect(() => {
    fetch();
  }, []);

  const handleRemove = (id) => {
    removeFromCart(id).then(fetch).catch(console.error);
  };

  const handleQty = (id, qty) => {
    if (qty < 1) return;
    updateCartItem(id, { quantity: qty })
      .then(fetch)
      .catch(console.error);
  };

  const total = items.reduce(
    (sum, it) => sum + (it.totalPrice ?? it.basePrice * (it.quantity || 1)),
    0
  );

  const formatSelections = (sel) => {
    if (!sel || Object.keys(sel).length === 0) return "None";

    return Object.entries(sel)
      .map(([key, val]) => `${key}: ${val?.name || "N/A"}`)
      .join(", ");
  };

  const formatToppings = (tops) => {
    if (!tops || tops.length === 0) return "None";

    return tops.map((t) => t.name).join(", ");
  };

  if (!items.length)
    return <Typography sx={{ p: 3 }}>Your cart is empty.</Typography>;

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" sx={{ mb: 3 }}>
        My Cart
      </Typography>

      <Grid container spacing={2}>
        {items.map((it) => (
          <Grid item xs={12} key={it.id}>
            <Paper
              sx={{
                display: "flex",
                alignItems: "center",
                p: 2,
                borderRadius: 3,
              }}
            >
              <img
                src={`/images/${it.image}`}
                alt={it.name}
                style={{
                  width: 120,
                  height: 120,
                  borderRadius: 8,
                  objectFit: "cover",
                  marginRight: 16,
                }}
              />

              <Box sx={{ flex: 1 }}>
                <Typography variant="h6">{it.name}</Typography>

                <Typography sx={{ mt: 1 }}>
                  <b>Selections:</b> {formatSelections(it.selectedSingle)}
                </Typography>

                <Typography>
                  <b>Toppings:</b> {formatToppings(it.selectedToppings)}
                </Typography>
              </Box>

              <Box sx={{ textAlign: "right" }}>
                <TextField
                  type="number"
                  value={it.quantity}
                  onChange={(e) =>
                    handleQty(it.id, Math.max(1, parseInt(e.target.value)))
                  }
                  sx={{ width: 80, mb: 1 }}
                  InputProps={{ inputProps: { min: 1 } }}
                />

                <Typography variant="h6">₹{it.totalPrice}</Typography>

                <Button
                  color="error"
                  onClick={() => handleRemove(it.id)}
                  sx={{ mt: 1 }}
                >
                  Remove
                </Button>
              </Box>
            </Paper>
          </Grid>
        ))}
      </Grid>

      <Typography variant="h5" sx={{ mt: 3 }}>
        Total: ₹{total}
      </Typography>

      <Button
        variant="contained"
        fullWidth
        color="primary"
        sx={{ mt: 3, py: 1.5 }}
        onClick={() => navigate("/checkout")}
      >
        Proceed to Checkout
      </Button>
    </Box>
  );
}
